INSERT INTO `goal_translation` (`id`, `translatable_id`, `name`, `out_put`, `out_come`, `description`, `locale`) VALUES
(10, 5, 'Goal 1: Innovation in Teaching and Learning (35.62%)', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 1. Improved, higher education access and equity&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 2. Improved relevance and quality of education&nbsp;</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 3. Enhanced students&#39; engagement and success&nbsp;</span></p>\r\n', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\">Outcome 1. Environment that promotes increased success</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\">Outcome 2. Higher quality of life that creates a community free to pursue scientific advancements</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\">Outcome 3. Competitive advantage that allows building better products and services for customers</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '', 'en'),
(11, 5, 'Galma 1: Hojiilee Kalaqaa Baruufi Barsiisuu Keessatti (35.62%)', '<p>Barbachisummaa fi Qulqullina barnootaa mirkaneessuu.</p>\r\n\r\n<p>hirmaannaa baratootafi milka&#39;ina baratoota jajjabessuu</p>\r\n', '<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#3498db\">1 .milka&#39;naaf haala mijataa uuma</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#3498db\">2.jireenya bareeda akka jiraannu taasiisa</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#3498db\">3.maamiltootaaf oomisha bareedaafi tajajila bu&#39;a qabeessa akka argataan godha</span>.</span></p>\r\n', '<p>//</p>\r\n', 'or'),
(12, 5, 'ግብ 1. ፈጠራ በመማር- ማስተማር ', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>ውጤት 1. የተሻሻለ የከፍተኛ ትምህርት ተደራሽነትና ፍትሃዊነት </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>ውጤት 2. የተሻሻለ የትምህርት ጥራት ውፅዓት </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>ውጤት 3. የተሻሻለ የተማሪዎች ተሳትፎና ስኬት</strong></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ስኬት 1. ለበለጠ&nbsp;ስኬት የሚያበረታታ የትምህርት ከባቢን መፍጠር</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ስኬት 2. ሳይንሳዊ እድገቶችን ምርኩዝ ያደረገና&nbsp;የተሻለ አኗኗር ሊፈጥር የሚያስችል&nbsp;ነፃ ማህበረሰብ መገንባት</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ስ</span></span><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ኬት 3. ለደንበኞች የተሻሉ ምርቶችና አገልግሎቶችን ማቅረብ የሚያስችል ተወዳዳሪ ጥቅም ማጎልበት</span></span></p>\r\n', '', 'am'),
(13, 6, 'Goal 2. Excellence in research, innovation and technology transfer  (%19.58)', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">High-quality research, innovation &amp; technology</span></p>\r\n', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome 1: Develops a platform to share ideas</span></span></p>\r\n\r\n<p><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome 2: </span></span><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Promotes economic development through commercializing innovative&nbsp;<strong>technology</strong>.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">&nbsp;</span></span></p>\r\n', '', 'en'),
(14, 6, 'Galma 2: Qorannoo, Hojii Kalaqaafi Daddabarsa Teknoloojiitiin Bahanii mul’achuu (%19.58)', '<p>Qorannoo sadarkaa addunyatti bakka qabu geggessuuf&nbsp; aadaa fi dhimma qorannoo irratti haala mijataa ni uuma</p>\r\n', '<p>Qorannoo qulqullina qabu,hojii qalaqaa fi daddabarsa Tekinoolojii&nbsp;</p>\r\n', '<p>//</p>\r\n', 'or'),
(15, 6, 'ግብ 2. የምርምር፣ ፈጠራና ቴክኖሎጂ ሽግግር ልዕቀት', '<p>ከፍተኛ ጥራት ያለው ምርምር፣&nbsp;ፈጠራና ቴክኖሎጂ</p>\r\n', '<p>በምርምር፤ ፈጠራና ቴክኖሎጂ ሽግግር በአገር አቀፍና በዓለም አቀፍ ደረጃ የተሻሻለ የጅማ ዩኒቨርሲቲ ፕሮፋይል</p>\r\n', '', 'am'),
(16, 7, 'Goal 3: Community Impact through Empowerment   (15.84%)', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">The state-of-the-art CBE-Innovation Center establish JU&rsquo;s educational philosophy innovated towards societal needssss</span></p>\r\n', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome&nbsp;1: Satisfied society and partners </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome&nbsp;2:&nbsp;Empowered and prosperous&nbsp;community </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome&nbsp;3:&nbsp;Improved health outcomes of beneficiaries, both local and international</span></span></p>\r\n', '', 'en'),
(17, 7, '   Galma 3 . Uummata Aangessuun Cimsuu (15.84%)', '<p>//</p>\r\n', '<p>lakkoofsa baratootafi hojetoota lammilee idil-addunyaa&nbsp;&nbsp;yuuniversitii Jimmaa kessatti argamanii&nbsp;&nbsp;guddisuu</p>\r\n', '<p>//</p>\r\n', 'or'),
(18, 7, 'ግብ 3: ማኅበረሰቡን በማብቃት ውጤታማነትን ማጎልበት', '<p>የዘመናዊ CBE- ፈጠራ ማዕከል ይቋቋማል የ JU ትምህርታዊ ፍልስፍና የህብረተሰቡን ፍላጎቶች ያሳካል</p>\r\n', '<p style=\"text-align:justify\">የረካ ማህበረሰብ መፍጠር በአገር ውስጥና በዓለምአቀፍ ደረጃ የተጠቃሚዎች ጤና ማሻሻል የተቃለሉ/ የተፈቱ ብሔራዊ አንገብጋቢ ጉዳዮች አምራችና የበለፀገ ማህበረሰብ መገንባት</p>\r\n', '', 'am'),
(19, 8, 'Goal 4: Internationalization and Global engagement  (10.26%)', '<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Engaged Alumni, </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">increased proportion of international staff and student, </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">maximized participation of international staff and student in the university affairs</span></li>\r\n</ol>\r\n', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome 1: Significant Improvement in JU&#39;s world ranking</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Outcome 2:&nbsp;Improved visibility, recognition, and reputability&nbsp;</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'en'),
(20, 8, 'Galma 4: Addunyaalessummaafi Hirmaannaa Idila-addunyaawaa (10.26%)', '<p>/</p>\r\n', '<p>//</p>\r\n', '<p>//</p>\r\n', 'or'),
(21, 8, 'ግብ 4. ዓለምአቀፋዊነትና አለምአቀፍ ተሳትፎ', '<ol>\r\n	<li style=\"text-align:justify\">ንቁና ተሳታፊ ተመራቂዎች ፣</li>\r\n	<li style=\"text-align:justify\">የአለም አቀፍ ሰራተኞችና የተማሪ ብዛት መጨመር</li>\r\n	<li style=\"text-align:justify\">በዩኒቨርሲቲ ጉዳዮች ውስጥ&nbsp;ከፍተኛ የአለም አቀፍ ሰራተኞች እና የተማሪ ተሳትፎ</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n', '<ul>\r\n	<li>በዩኒቨርሲቲዎች ደረጃ በዓለም ላይ ጉልህ መሻሻል</li>\r\n	<li>የተሻሻለ እይታ, እውቅና እና የውክልና የውክልና</li>\r\n</ul>\r\n', '', 'am'),
(22, 9, 'Goal: 5 Transformational Leadership and Governance ( 12.7 % )', '<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Improved system of management </span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Teamwork and creating a conducive work environment to achieve common vision</span></li>\r\n	<li style=\"text-align:justify\">\r\n	<p><span style=\"font-family:Arial,Helvetica,sans-serif\">enable the search for new opportunities, creation of a common vision, and motivation and guidance of employees</span></p>\r\n	</li>\r\n	<li style=\"text-align:justify\">\r\n	<p><span style=\"font-family:Arial,Helvetica,sans-serif\">increases the emotional connection&nbsp;between the supervisor and the follower in such a way that follower feels more confident to perform beyond expectations.</span></p>\r\n	</li>\r\n</ol>\r\n', '<p><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Quality of services Improved</span></span></p>\r\n', '\\', 'en'),
(23, 9, 'Galma 5: Hooggansaa fi Bulchiinsa JIjjiirmaa ( 12.7 % )', '<p>//</p>\r\n', '1.sirna bulchinsa foya\'aa.', '<p>1.sirna bulchinsa foya&#39;aa.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'or'),
(24, 9, 'ግብ፦ የለውጥ አመራርና አስተዳደር', '<ol>\r\n	<li style=\"text-align:justify\">የተሻሻለ የአመራር ስርዓት</li>\r\n	<li style=\"text-align:justify\">በአነስተኛ ዋጋና ሀብት የተቀመጠው ግብ ላይ ለመድረስ የሚያስችል ግብ&nbsp;በትክክለኛው አቅጣጫ ማቀናጀት</li>\r\n	<li style=\"text-align:justify\">የጋራ ራዕይን ለማሳካት የቡድን ሥራ መሥራትና ምቹ ሁኔታ የስራ ከባቢ መፍጠር</li>\r\n</ol>\r\n', '<p>የአገልግሎቶች ጥራት መሻሻል</p>\r\n', '', 'am');
