INSERT INTO `initiative_behaviour_translation` (`id`, `translatable_id`, `name`, `description`, `locale`) VALUES
(3, 2, 'Constant', 'Data values that stay the same in every quarter year ', 'en'),
(4, 2, 'kurmana hundatti kan hin jijjiramne', 'lakoofssa kurmana hundatti oddo hin gegeeddaramin kan geggaffamn', 'or'),
(5, 2, 'በየሩብ ዓመት የማይለወጥ', 'የሚቀርቡ ዕቅዶች በየሩብ ዓመቱ ተመሳሳይ ሆነው ይመዠገባሉ', 'am'),
(6, 3, 'Incremental ', 'The process of increasing in number, size, quantity, or extent.\r\n increasing gradually by regular degrees or additions', 'en'),
(7, 3, 'kuramana hundatti dabalaa kan deemu', 'kuramana hundatti dabalaa kan deemu', 'or'),
(8, 3, 'እያደገ የሚሄድ', 'በየሩብ ዓመቱ እየጨመረ የሚሄድ ለምሳሌ አሁን ያለውን የደንበኞች እርካታ ከ56% ላይ በየሩብ ዓመቱ 10% እየተሻሻለ ቢሄድ በዓመቱ መጨረሻ 96% ማድረስ ይቻላል ', 'am'),
(9, 4, 'Decremental ', 'The act or process of decreasing or becoming gradually less.\r\n\r\nThe amount lost by gradual diminution or waste.', 'en'),
(10, 4, 'kurmaana hundatti hir\'achaa kan deemu', 'kurmaana hundatti hir\'achaa kan deemu', 'or'),
(11, 4, 'እየቀነሰ የሚሄድ', 'በየሩብ ዓመቱ እየቀነሰ የሚሄድ  ለምሳሌ የፍሳሽ ቆሻሻ ብከለትን አሁን ካለበት 60% ወደ በየሩብ አመቱ 10% ብንቀነስ በዓመቱ መጨረሻ የብክለት መጠኑን 20% ማድረስ ይቻላል', 'am'),
(12, 5, 'Additive', 'These are numbers that can be added in every quarter ', 'en'),
(13, 5, 'Kurmaana arfan irratti dabalaa kan deemu', 'lakofsaa kurmanaan dabalataa kan demuu', 'or'),
(14, 5, 'ተደማሪ', 'እነዚህ በየሩብ ዓመቱ ሊደመሩ የሚችሉ ቁጥሮች ናቸው ', 'am');
