INSERT INTO `objective_translation` (`id`, `translatable_id`, `name`, `out_put`, `out_come`, `description`, `locale`) VALUES
(1, 1, 'Obj. 1 Enhance access to and equity in higher education and training ', '<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 1. Declined enrollment of undergraduate students</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 2. Increased enrollment of postgraduate students</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Output 3. improved participation of women and students with disabilities</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Accessible and equitable higher education and training</span></span></p>\r\n', '', 'en'),
(2, 1, 'Kaayyoo 1: Leenjiifi Barnoota Olaanoo Keessatti Carraafi Walqixxummaa Dhugaa Dabaluu ', '', '<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong><span style=\"font-family:Arial,Helvetica,sans-serif\">Milka&#39;na: gahiinsa fi&nbsp;qajeelummaa&nbsp;barumsa sadarkaa olaanaa</span></strong></span></p>\r\n', '<p>//</p>\r\n', 'or'),
(3, 1, 'ዓላማ 1: የከፍተኛ ትምህርት ተደራሽነትና ፍትሃዊነት', '<p>ውጤት 1. የመጀመሪያ ደረጃ ተማሪዎች ቁጥር ይቀንሳል</p>\r\n\r\n<p>ውጤት 2. የተመራቂ ተማሪዎች ቁጥር ይጨምራል</p>\r\n\r\n<p>ውጤት 3. የሴቶችና የአካል ጉዳተኛ ተማሪዎች በከፍተኛ ትምህርትና ሥልጠና ያላቸው ተሳትፎ ይሻሻላል</p>\r\n', '<p><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ስኬት 1. ተደራሽ እና ፍትሃዊ የከፍተኛ ትምህርት እና ስልጠና</span></span></p>\r\n', '', 'am'),
(4, 2, 'Obj. 2. Improve quality and relevance of higher education and training ', '<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Competent and qualified graduates that fit the field of work</span></p>\r\n', '<ul>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>Productive and&nbsp;sustainable livelihoods, </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>Peaceful and democratic community </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>Well-beingness of JU and its customers </strong></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'en'),
(5, 2, 'Kaayyoo 2: Qulqullinaafi Fudhatamummaa Leenjiifi Barnoota Olaanoo Fooyyessuu', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(6, 2, 'ዓላማ 2. የከፍተኛ ትምህርትና ሥልጠና ጥራትና ተገቢነት ማሻሻል', '<p>ውጤት 1. ከስራ መስክ ጋር የሚጣጣሙ ብቃት ያላቸውና ብቃት ያላቸው ተመራቂዎች</p>\r\n', '<ul>\r\n	<li><span style=\"color:#2980b9\"><strong>ምርታማና ዘላቂ ኑሮን ማዳበር ፣ </strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>ሰላማዊና ዴሞክራሲያዊ አገር መገንባት&nbsp;</strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>የዜጎችን ደህንነት ማሳደግ&nbsp;</strong></span></li>\r\n</ul>\r\n', '', 'am'),
(7, 3, 'Obj 3. Foster students\' engagement and success ', '<p>Enhanced holistic students&rsquo; engagement and success</p>\r\n', '<p>Self-reliant, heuristic, and successful student</p>\r\n', '', 'en'),
(8, 3, 'Kaayyoo 3: Hirmaannaa Barattootaa Dabaluufi Milkaa’ina', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(9, 3, 'ዓላማ 3. የተማሪዎችን ተሳትፎ እና ስኬት ማበልፀግ', '<p>የተሻለ ሁለንተናዊ ተማሪዎች ተሳትፎ እና ስኬት</p>\r\n', '<p>የተማሪዎችን ተሳትፎ እና ስኬት ማበልፀግ&nbsp;</p>\r\n', '', 'am'),
(10, 4, 'Obj 4. Enhance Research Environment and Culture', '<ol>\r\n	<li>High staff involvement in research u</li>\r\n	<li>effective and efficient research environment and culture</li>\r\n</ol>\r\n', '<p>Increased quality and quantity of research outputs</p>\r\n', '', 'en'),
(11, 4, 'Kaayyoo 4: Aadaafi Dhimma Qorannoo Cimsuu ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(12, 4, 'የምርምር አካባቢ እና ባህልን ማጎልበት', '<p>በምርምር ሥራ የምሁራን ተሳትፎ ይጎለብታል፣ ውጤታማና ውጤታማ የምርምር አካባቢ ይመሰረታል</p>\r\n', '<p>የምርምር ውጤቶች ጥራትና ብዛት መጨመር</p>\r\n', '', 'am'),
(13, 5, 'Obj 5. Enhance discovery, innovation, and technology transfer', '<p>Increased number of discoveries, innovations and technology transfer</p>\r\n', '<p>Improved JU global status</p>\r\n', '', 'en'),
(14, 5, 'Kaayyoo 5: Argannoo, kalaqaafi cehumsa teekinooloojii guddisuu ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(15, 5, 'ዓላማ  5. ግኝትን,   ፈጠራን እና የቴክኖሎጂ ዝውውርን ማሻሻል', '<p>የምርምር ውጤቶች ጥራትና ብዛት መጨመር</p>\r\n', '<p>የተሻሻለ የ JU ዓለም አቀፍ ደረጃ</p>\r\n', '', 'am'),
(16, 6, 'Obj 6. Strengthen research collaboration, partnership, and networking', '<p>Collaborative research projects and partnership</p>\r\n', '<p>Increased JU`s global visibility and influence</p>\r\n', '', 'en'),
(17, 6, 'ዓላማ  6 ክልላዊ  እና አለም አቀፍ የምርምር ትብብር, አጋርነት, እና አውታረ መረብ', '<p>ተባባሪ የምርምር ፕሮጀክቶች እና አጋርነት</p>\r\n', '<p>የጁዩ ዓለም አቀፍ እይታ እና ተፅዕኖ ጨምሯል</p>\r\n', '', 'am'),
(18, 7, 'Obi 7. Enhance research engagement, communication, and dissemination ', '<p>/</p>\r\n', '<p>/</p>\r\n', '', 'en'),
(19, 7, 'Kaayyoo 7: Hirmaannaa, quunnamtiifi tamsaasa qorannoo cimsuu ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(20, 7, 'ዓላማ 7 የምርምር ተሳትፎ፣ ሐሳብ ልውውጥና ስርጭት ማሻሻል', '<p>?</p>\r\n', '<p>?</p>\r\n', '', 'am'),
(21, 8, 'Obj 8. Provide high-quality and comprehensive services to local, national, and global communities', '<p>Provide high-quality and comprehensive services to local, national, and global communities</p>\r\n', '<p>/</p>\r\n', '', 'en'),
(22, 8, 'Kaayyoo 8: Hawaasa naannoo, biyyoolessaafi idil-addunyaaf tajaajila waliigalaa kennuu', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(23, 8, 'ዓላማ 8 ለአካባቢያዊ፣ ብሔራዊና ዓለምአቀፍ ማኅበረሰብ  ከፍተኛ ጥራት ያለውና ሁሉአቀፍ አገልግሎቶች ማቅረብ ', '<p>በዕውቀት ላይ የተመሰረተ እና ተያያዥ የሆኑ አጠቃላይ አገልግሎቶች ለሕብረተሰቡ ተሰጡ</p>\r\n', '<p>/</p>\r\n', '', 'am'),
(24, 9, 'Obj 9.  Expand and qualify the Medical Centers', '<p>Strengthened JUMC Quality healthcare provided to the local and international</p>\r\n', '<p>JUMC becomes a preferred center for medical tourism Improved health outcomes of beneficiaries, both local and international JUMC</p>\r\n', '', 'en'),
(25, 9, 'Kaayyoo 9:  Gidduugala Fayyaa Yuunivarsiitii Jimmaa Babal’isuufi Tajaajila Inni  Kennu Guddisuu', '<p>//</p>\r\n', '<p>//</p>\r\n', '<p>//</p>\r\n', 'or'),
(26, 9, 'ዓላማ 9 የሕክምና ማዕከሎችን ማስፋፋትና ማብቃት ', '<p>የተጠናከረ JUMC ለአካባቢና ለዓለም አቀፍ የጤና አገልግሎት የሚሰጥ ጥራት ያለው የጤና አገልግሎት</p>\r\n', '<p>የህክምና ቱሪዝም ተመራጭ ማዕከል ሆነ በአካባቢውም ሆነ በዓለም አቀፍ ደረጃ ተጠቃሚ የሆኑ ሰዎች የተሻለ የጤና ውጤት</p>\r\n', '', 'am'),
(27, 10, 'Obj 10.  Enhance the spirit of volunteerism in JU communities', '<p>coordinate community service on volunteerism initiatives The voluntary impacts on the national pressing issues</p>\r\n', '<p>/</p>\r\n', '', 'en'),
(28, 10, 'Kaayyoo 10: Kaka’umsa Hawaasni Yuunivarsiitii Jimmaa Tola Ooltummaaf Irratti Qabu Guddisuu', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(29, 10, 'ዓላማ 10.  በጅማ ዩኒቨርሲቲ ማህበረሰብ ውስጥ የበጎ ፈቃድ አገልግሎትን ማበልፀግ ', '<p>የበጎ ፈቃድ መርሃ ግብሮች ላይ የማህበረሰብ አገልግሎትን ለማስተባበር የተቋቋመ ቢሮ መኖር በበጎ ፈቃደኝነት በሀገራዊ አንገብጋቢ ጉዳዮች ላይ የሚያሳድረው ተፅዕኖ</p>\r\n', '<p>/</p>\r\n', '', 'am'),
(30, 11, 'Obj 11. Innovate Ju’s brand educational philosophy (CBE)', '<p>JU&rsquo;s brand educational philosophy innovated towards societal needs</p>\r\n', '<p>/</p>\r\n', '', 'en'),
(31, 11, 'kaayyoo 11: Ittiin Beekama Yuunivarsiitii Jimmaa Kan Ta’e CBE Beeksisuu  (Innovate JU’s brand, CBE)', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(32, 11, 'ዓላማ 11. የጅማ ዩኒቨርሲቲ የትምህርት ፍልስፍና የሆነውን (CBE)ን ማበልፀግ ', '<p>የJU ምልክት የትምህርት ፍልስፍና ወደማ ህበረሰባዊ ፍላጎቶች ላይ</p>\r\n', '<p>/</p>\r\n', '', 'am'),
(39, 15, 'Obj 12. International Branding and Marketing', '', '<p>Improved global JU ranking Increased JU visibility, Recognition and Reputation</p>\r\n', '', 'en'),
(40, 15, 'Kaayyoo 12: Beekkamtiifi Barbaadamummaa Yuunivarsiitiin Jimmaa Sadarkaa  Idila-addunyaatti  Qabu Guddisuu', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(41, 15, 'ዓላማ 12 ዓለም አቀፍ ብራንድ እና ማርኬቲንግ', '<p>ዓላማ 12 ዓለም አቀፍ ብራንድ እና ማርኬቲንግ</p>\r\n', '<p>የተሻሻለ ዓለም አቀፍ የJU ደረጃ እየጨመረ የመጣውየJUእ ይታ, እውቅና እና ዝና</p>\r\n', '', 'am'),
(42, 16, 'Obj 13. Maximize participation of JU Expatriate staffs/students in University affairs ', '<p>-Quick assimilation of international visitors, students, and staffs in the community -Increased Capacity building - Increased collaborations with the home institution/country of the international staff and student -Vibrant international staffs and students - Increased participations of staff and students - A proud sense of belonging - Satisfied international staff and students -Improve participation of Expatriate staff and student in the university affairs</p>\r\n', '<p>An international community with a sense of belonging and proud JU ambassador with enormous contribution to the university&rsquo;s affairs and as a consequence contribute to the Jimma university vision and mission.</p>\r\n', '', 'en'),
(43, 16, 'Kaayyoo 13: Dhimmoota Yuunivarsitii Jimmaa irratti Hirmaannaa Lammiilee Biyyaa Alaa Dabaluu/ol guddisuu/ ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(44, 16, 'ዓላማ 13  የJU የውጭ ጉዳይ ሰራተኞች/ ተማሪዎች በዩኒቨርሲቲ ጉዳዮች ላይ ያላቸውን ተሳትፎ ከፍ ማድረግ', '<p>-በህብረተሰቡ ውስጥ ያሉ ለም አቀፍ ጎብኝዎች, ተማሪዎች እና ሰራተኞች ፈጣን ውህድ -የአቅም ግንባታ መጨመር - ከዓለም አቀፍ ሰራተኞችና ተማሪዎች የቤት ተቋም/አገር ጋር ያለው ትብብር ጨምሯል -ህወሓት አለም አቀፍ ሰራተኞች እና ተማሪዎች - የሠራተኞች እና ተማሪዎች ተሳትፎ መጨመር - የኩራት ስሜት የአባልነት ስሜት - የረካዓለም አቀፍ ሠራተኞች እና ተማሪዎች -በዩኒቨርሲቲው ጉዳይ የውጭ ሀገር ሰራተኞችና ተማሪዎች ተሳትፎ ማ ሻሻል</p>\r\n', '<p>በዩኒቨርሲቲው ጉዳይ ላይ ከፍተኛ አስተዋፅኦ በማድረግ እና በዚህም ምክንያት የጂማ ዩኒቨርሲቲ ራዕይ እና ተልዕኮ ላይ ከፍተኛ አስተዋፅ ኦያለው አባል እና ኩሩ JU አምባሳደር የሆነ ዓለምአቀፍ ማህበረሰብ.</p>\r\n', '', 'am'),
(45, 17, 'Obi 14.  Enhancing Policy Shift in Governance ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'en'),
(46, 17, 'Kaayyoo 14: Danbii Bulchiinsaa keessatti Imaammata Ce’umsaa ykn Jijjiiramaa Fooyyeessuu', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(47, 17, 'ዓላማ 14 የአስተዳደር ፖሊሲ መቀየር', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>የፖሊሲ ለውጥ አሁን ባሉ መዋቅሮች ላይ ደረጃ በደረጃ መለወጥን ያመለክታል, ወይም አዳዲስ እና አዳዲስ ፖሊሲዎች</p>\r\n', 'am'),
(48, 18, 'Obi 15. Ensure effective and efficient provision and utilization of resources (human, material, and financial) ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'en'),
(49, 18, 'Kaayyoo 15: Kenniinsa Tajaajila Bu’a Qabeessaa fi Gahaa ta’e fi akkasumas, Itti fayyadama Qabeenyaa (humna namaa, meeshaaleefi maallaqaa) isa sirrii ta’e Dhugoomsuu/Mirkaneessuu/ ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(50, 18, 'ዓላማ 15  የሀብት (የሰው፣ቁሳዊ እና የገንዘብ) ውጤታማና ውጤታማ የሆነ ዝግጅትና አጠቃቀም ማረጋገጥ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>ይህ ምየታሰበውን ዓላማ ለማሳካት በጥበበኝነት ጥቅም ላይ መዋሉን ማረጋገጥን ያጠቃልላል</p>\r\n', 'am'),
(51, 19, 'Obj 16. Ensure Good Governance and Transformational Leadership', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'en'),
(52, 19, 'Kaayyoo 16: Bulchiinsa Gaarii fi Hooggansa Jijjiiramaa Dhugoomsuu/ Mirkaneessuu/.', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>/</p>\r\n', 'or'),
(53, 19, 'ዓላማ 16 የመልካም አስተዳደርና የለውጥ አመራር ማረጋገጥ', '<p>/</p>\r\n', '<p>/</p>\r\n', '<p>የአመራርና የአስተዳደር ሥርዓት በክፍሎቹ መካከል ያለውን ግንኙነት ማየትና ማረጋገጥ ያስፈልገዋል ። ለዩኒቨርሲቲው አንድ ዓይነት ስሜት እንዲኖረው ያደርጋል፣ ፖሊሲዎችን ይፈቅድለታል፣ እንዲሁም እቅዶችንና ውሳኔዎችን በተጠያቂነት፣ ምላሽ በሚሰጥ እና ወጪ ቆጣቢ በ ሆነ መንገድ ሕጋዊ ያደርጋል።</p>\r\n', 'am'),
(54, 6, 'Kaayyoo 6: Waltumsa, gamtoomaafi walqabatiinsa (network) qorannoo cimsuu', '<p>Collaborative research projects and partnership</p>\r\n', '<p>Increased JU`s global visibility and influence</p>\r\n', '', 'or');
