INSERT INTO `perspective_translation` (`id`, `translatable_id`, `name`, `description`, `locale`) VALUES
(10, 5, 'Internal Business Process Perspective -IBP ', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Internal business process measures JU&#39;s organizational efficiency and it gives the answer to the key question &ldquo;on what must we excel at?&rdquo;. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">It is one of the most important perspectives in the strategy map and all objectives in this perspective will ensure the long-term success of JU and its stability. The internal process focuses on financial and intangible resources to transform the consumer into material products. </span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Under this view, there are<strong> five objectives </strong></span></p>\r\n\r\n<ol>\r\n	<li><strong><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Objective 1: Enhance access to and equity in higher education and training (7.47%), </span></span></strong></li>\r\n	<li><strong><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Objective 2: Improve quality and relevance of higher education and training (18.07%), </span></span></strong></li>\r\n	<li><strong><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Objective 4: Enhance Research Environment and Culture (5.61%), </span></span></strong></li>\r\n	<li><strong><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Objective 5: Enhance discovery, innovation, and technology transfer (4.66%), and </span></span></strong></li>\r\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong><span style=\"color:#2980b9\">Objective 11: Innovate JU&rsquo;s brand, CBE (2.77%)</span></strong></span></li>\r\n</ol>\r\n', 'en'),
(11, 5, 'Kallattii xiyyeeffannoo Adeemsa Hojii Keessoo', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Kallattiiwwan xiyyeeffannoo ijoo afur jiran keessaa isa tokko ta&rsquo;ee, adeemsonni bu&rsquo;aa dabalan akka walsimatanii deeman taasisuun adeemsa tajaajila bu&rsquo;a-qabeessa ta&rsquo;an kamiin irra caalaa fooyyofneee bahuu dandeenya gaaffii jedhuuf deebii laata. Adeemsi hojii keessoo kun qabeenya sammuu, faayinaansii fi tajaajila gara bu&rsquo;a-qabeessummaatti jijjiiruu danda&rsquo;an irratti xiyyeeffata. Kallattii xiyyeeffannoo kana jalatti karoorawwan tarsiima&rsquo;aa ja&rsquo;a kan haammataman yoo ta&rsquo;an isaanis: qaqqabiinsaa fi haqummaa barnoota olannoo, qulqullinaaf gahumsa barnootaa, carraa hojii uumuuf kallaqa, qorannoof kallaqa hojiitiif haala mijeesuu, banootaaf qorannoowwan addunyawwaa jajjabeessuu fi barnootaaf qorannoon waliigalteewwan sadarkaa addunyaatti uummu dha.</span></p>\r\n', 'or'),
(12, 5, 'ውስጣዊ አሠራር ዕይታ', '<p style=\"text-align:justify\">ከአራቱ ሚዛናዊ አፈጻጸም መለኪያ ሌንሶች አንዱ የሆነው ይህ ዕይታ እሴት የሚጨምሩ ሂደቶች እርስ በርሳቸው በመመጋገብ ለውጤታማ አገልግሎት አሰጣጥ በየትኞቹ አሠራሮች ልቀን መገኘት አለብን ለሚለው ጥያቄ ምላሽ ይሰጣል፡፡ የውስጥ አሠራር ሂደት ዕይታ፣ ፋይናንስና ተገልጋይ ወደ ቁሳዊ ወደውጤት መለወጥ በሚያስችሉ አእምሮአዊ /Intangible/ ሃብቶች ላይ ያተኩራል፡፡</p>\r\n\r\n<p><span style=\"color:#2980b9\"><strong>በዚህ ዕይታ ስር አምስት ስትራተጂያዊ ዓላማዎች ያሉ ሲሆኑ እነርሱም </strong></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#2980b9\"><strong>ከፍተኛ ትምህርት ተደራሽትና ፍትሃዊነት ማጎልበት (7.47%)፣ </strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>ዓላማ 2: የከፍተኛ ትምህርት ጥራትና ተገቢነት ማሻሻል (18.07%)፣ </strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>ዓላማ 4. የምርምር አካባቢና ባህል ማሻሻል (5.61%)፣ </strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>ዓላማ 5. ግኝት፣ ፈጠራና የቴክኖሎጂ ሽግግር ማሻሻል (4.66%)፣ </strong></span></li>\r\n	<li><span style=\"color:#2980b9\"><strong>ዓላማ 11. የትምህርት ፍልስፍና ኢኖቬት ማድረግ (2.77%) ናቸው</strong></span></li>\r\n</ol>\r\n', 'am'),
(13, 6, 'Customer Perspective ', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">This perspective considers external customers&#39; points of view about JU, which is a crucial factor for creating financial success, revenue, and services. It indicates how JU&rsquo;s strategy and operations add value to customers.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>The Six&nbsp;objectives included in this perspective are </strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 3: Foster students&#39; engagement and success (10.08%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 7: Enhance research engagement, communication, and dissemination (6.54%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 8: Provide comprehensive services to local, national, and global communities (3.83%)</strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 10: Enhance the spirit of volunteerism in JU communities (5.47%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 13: Maximize the participation of Expatriate staff/student in JU affairs (1.83%)</strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 16:&nbsp; Ensure Good Governance and Transformational Leadership (6.55%)</strong></span></span></li>\r\n</ol>\r\n', 'en'),
(14, 6, 'Kallattii xiyyeeffannoo Maamilaa ', '<p><span style=\"font-family:Arial,Helvetica,sans-serif\">Kallaattiin xiyyeeffannoo kun maamilttoota alaarratti kan xiyyeeffatu ta&rsquo;ee, kaayyoowwan tarsiima&rsquo;aa kudha afur kan qabu yoo ta&rsquo;u isaan keessaa shan maamilarratti xiyyeeffatu. Isaanis kallaqaaf ce&rsquo;umsa teeknoloojii babal&rsquo;suu, barnootaaf tajaajila hawaasa bal&rsquo;aa cimsuu, tajaajila fayyaa fooyya&rsquo;aa kennuu, kunuunsa nannoo fufiinsa qabuu fi bulchiinsa gaarii mirkaneessuu dha.</span></p>\r\n', 'or'),
(15, 6, 'የደንበኞች እይታ', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">ይህ ዕይታ ለውጭ ተገልጋዮች ትኩረት የሚሰጥ ሲሆን የውስጥ ሰራተኞች እርካታ ግን በመማማርና እድገት ዕይታ ስር ተካትቷል፡፡</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><strong>ከተቋሙ 16 ስትራተጂያዊ ዓላማዎች ስድስቱ ደንበኛ ተኮር ሲሆኑ </strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 3: - የተማሪዎችን ተሳትፎና ስኬት ማሳደግ (10.08%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 7. የምርምር ተሳነታፊነት፣ ኮሙኒኬሽንና ስርጭት (6.54%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 8.&nbsp;</strong></span></span><strong><span style=\"color:#2980b9\"><span style=\"font-family:Ebrima\">ለአካባቢ፣ ሪጅናልና</span> </span><span style=\"font-family:Ebrima\"><span style=\"color:#2980b9\">አለምአቀፍ ማህበረሰብ የተሟላ አገልግሎት መስጠት (3.83%)</span></span></strong></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 10. የፈቃደኝነት አገልግሎት (5.47%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 13: የውጭ ዜጎችን ተሳትፎ በዩኒቨርሲቲ ማሳደግ (1.83%) </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>ዓላማ 16. መልካም አስተዳደርና የለውጥ አመራርን ማረጋገጥ (6.55%)</strong></span></span></li>\r\n</ol>\r\n', 'am'),
(16, 7, 'Learning and Growth Perspective-LG', '<p>It indicates the ability of the internal business processes to add value to customers and to improve stakeholders&#39; wealth. Learning and growth measures JU&#39;s future performance and provides insight to tell &ldquo;Can we continue to improve and create value?&rdquo;. The measures focus on innovation and developing new ways to add value towards adapting to the evolving environment. Example: number of new skills learned by employees every year.</p>\r\n\r\n<p><strong>The 3 objectives included in this perspective are </strong></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 9: Expand and qualify Medical Centers (3.77%) </strong></span></span></li>\r\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 12: Strengthen International Branding and Marketing (8.43%) </strong></span></span></li>\r\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 14: Enhancing Policy Shift in Governance (3.72%)</strong></span></span></li>\r\n</ol>\r\n', 'en'),
(17, 7, 'Kallattii xiyyeeffannoo Barnootaa fi dagaaginaa/guddinaa', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Kallaattiin xiyyeeffannoo kun dandeettii waliigala dhaabbatichaa akkamiin guddisuu dandeenya gaaffii jedhuuf kan deebii laatu ta&rsquo;ee kaayyoowwan lama jalattii haamatamaniiru. Issnis: barsiisotaa fi barattoota addunyaa gahumsa olaanaa qaban simachuu fi misooma human namaaf bulchiinsa dhaabbatichaa fooyyeessuuf dandeettii keessoo cimsuu fi kallattiiwwan sadii iiti-quufiinsa hojjettoota keessaa dabaluu danda&rsquo;an kan of keessaa qabu yoo ta&rsquo;u isaan kunis</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>qabeenya namaa jalatti: humna nama baratee, gahumsaaf ilaalcha, itti-quufiinsa hojjettootaa, </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Aadaa adeemsa dhaabbatichaa jalatti: gahumsa bulchiinsaa, hojii garee, aadaaf sona dhaabbatichaa fi </strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Qabeenya odeeffannoo jalatti: adeemsa odeeffannoof teeknoloojii, misooma sooftweeriif neetwoorkii, daataa beezii qopheessuuf fooyyeessuu ta&rsquo;u.</strong></span></span></li>\r\n</ol>\r\n', 'or'),
(18, 7, 'መማርና ዕድገት እይታ', '<p style=\"text-align:justify\">ይህ ዕይታ የተቋሙን ጠቅላላ አቅም እንዴት ማሳደግ እንችላለን ለሚለው ጥያቄ ምላሽ የሚሰጥ ሲሆን</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong>በስሩ ሶስት ዓላማዎች ተካትተዋል፤ </strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong>ዓላማ 9. የሕክምና ማዕከላትን ደረጃ ማሻሻል (3.77%) </strong></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong>ዓላማ 12. ዓለምአቀፍ ብራንዲንግና ማርኬቲንግ (8.43%) </strong></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong>ዓላማ 14: የአስተዳደር ፖሊሲ ለውጥና ትግበራ (3.72%)</strong></span></li>\r\n</ol>\r\n', 'am'),
(19, 8, 'Finance Perspective ', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">This perspective deals with&nbsp;developing the revenue generation and financial management sectors. This perspective shows the performance indicators for the implementation of the Capita Managemenet and Cash Flow.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\">This includes expanded sources of income and resources, properly utilized budgets and invested capital. The view is how can we provide higher service at a lower cost? It answers the question of how we can increase the use of resources effectively.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Arial,Helvetica,sans-serif\">The two objectives included here&nbsp;are&nbsp;</span></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 6: Strengthen research collaboration, partnership, and networking</strong></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"color:#2980b9\"><strong>Objective 15: Ensure Effective and Efficient Provision and Utilization of Resources (human, material, and financial) </strong></span>&nbsp;</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', 'en'),
(20, 8, 'Kallattii xiyyeeffannoo faayinaansii ', '<p style=\"text-align:justify\">Kallattiin xiyyeeffannoo kun kaayyoo tokko kan qabu ta&rsquo;ee galii maddisiisuuf bulchiinsa faayinaansii fooyyessuu irratti xiyyeeffata. Haaluma kanaan adeemsa bulchiinsa baajata kaappitaalaa fi yaa&rsquo;insa baajataa dhugoomsuun bu&rsquo;a-qabeessummaa fi raawwii madaaluuf fayyada. Kunis maddoota galii adda bahaniif qabeenya uuman, baajataaf kaappitaala kallattii sirrii ta&rsquo;een hojiirra oole ilaalata. Kallattiin xiyyeeffannoo kun gaaffiiwwan akkamittiin baasii xiqqoon tajaajila olaanaa kennuu dandeenya akkasumas fayyadama qabeenyaa akkamittiin bu&rsquo;a-qabessummaan guddisuu dandeenya jedhuuf deebii laata.</p>\r\n', 'or'),
(21, 8, 'ፋይናንስ እይታ', '<p style=\"text-align:justify\">በዚህ ዕይታ ስር ያለው አንድ ዓላማ ሲሆን ይህም የገቢ ማመንጫ ዘርፎችና የፋይናንስ አስተደዳር ማጎልበት ነው፡፡ ይህ ዕይታ የካፒታል ስራ አመራሩን /Capita Managemenet/ እና የገንዘብ ፍሰቱን /Cash Flow/ ተግባራዊ ለማድረግና የውጤት ስኬቶችን ለመመዘን አፈጻጸም አመልካቾችን ያሳያል፡፡</p>\r\n\r\n<p style=\"text-align:justify\">ይህ የተዘረጉ የገቢ ምንጮችና ያፈሯቸው ሃብቶች፣ በአግባቡ ጥቅም ላይ የዋለ በጀትንና ስራ ላይ የዋለ ካፒታልን ይመለከታል፡፡ ዕይታው እንዴት በአነስተኛ ወጪ ከፍ ያለ አገልግሎት መስጠት እንችላለን? የሀብት አጠቃቀምን እንዴት በውጤታማነት ማሳደግ እንችላለን ለሚሉ ጥያቄዎች ምላሽ ይሰጣል፡፡</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#2980b9\"><strong>በስሩ ሁለት&nbsp;ዓላማዎች ተካትተዋል፤</strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:Cambria,serif\"><strong><span style=\"font-family:Ebrima\"><span style=\"color:#2980b9\">ዓላማ 6. የምርምር ትብብር፣ አጋርነትና<strong> </strong>ትስስር ማጠናከር</span></span></strong></span>&nbsp;</li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#2980b9\"><span style=\"font-family:Cambria,serif\"><strong><span style=\"font-family:Ebrima\">ዓላማ 15. ቀልጣፋና</span>&nbsp; </strong><strong><span style=\"font-family:Ebrima\">ውጤታማ</span></strong><strong> </strong><strong><span style=\"font-family:Ebrima\">የ</span></strong><strong><span style=\"font-family:Ebrima\">ኃብት<strong> </strong>አጠቃቀምን ማረጋገጥ</span></strong></span></span></li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', 'am');
