INSERT INTO `sms` (`id`, `sender_id`, `reciver_id`, `send_date`, `text`) VALUES
(1, 1, 1, '2021-09-29', 'hi from mis thanks'),
(2, 2, 1, '2021-09-29', 'Mis training'),
(3, 2, 2, '2021-09-29', 'Mis training'),
(4, 2, 2, '2021-09-29', '1.  አይቤክስና ትሬዠሪ ስልጠና ፋይናንስ ለዳይሬክተሮች፣ ለፕላንና ፕሮግራም ኃላፊዎች፣ ለበጀት ሰራተኞች፣ ለCDE ፋይናንስ፣ ለአጋሮ ካምፓስ ፋይናንስና በጀት፣ ለላይዘን ኦፊስ ፋይናንስና በጀት ይሰጣል። \r\nቀን፡ ሐሙስ መስከረም 20 ቀን 2014 ዓም \r\nሰአት፡ ቀኑን ሙሉ    \r\nቦታ፡ ሲስኮ አዳራሽ \r\n\r\n2. አይቤክስና ትሬዠሪ ስልጠና ለፕሬዝዳንቶች፣ ኮሌጅ ዲኖች / ኢንስቲትዩት ም/ፕሬዝዳንቶች\r\nቀን፡ ዓርብ መስከረም 21 ቀን 2014 ዓም\r\nሰአት፡ ጧት ብቻ\r\nቦታ፡ ሴኔት አዳራሽ (ላፕቶፕ ይዘው ይምጡ)\r\n\r\n\r\n3. MIS training ለዋናው ግቢ ዳይሬክተሮች ስልጠና ይሰጣል። \r\nቀን፡  ዓርብ ጧት መስከረም 21 ቀን 2013  \r\nሰአት፡ ከ2፡30 ሰአት ጀምሮ \r\nቦታ፡ በሲስኮ ኣዳራሽ \r\n\r\n4. MIS training  ለኮሌጅ/ ኢንስቲትዩት ፕላንና ፕሮግራም ኃላፊዎች፣ ለኮሌጅ/ ኢንስቲትዩት አይሲቲ ኃላፊዎችና ሶስት ባለሙያዎችና የኮሌጅ/ ኢንስቲትዩት ሰልጣኝ አሰልጣኝ ሶስት መምህራን ስልጠና ይሰጣል።                                                      \r\nቀን፡  ዓርብ መስከረም 21 ቀን 2013 \r\nሰአት፡ ከሰዓት 8፡00 ጀምሮ\r\nቦታ፡ በሲስኮ ኣዳራሽ'),
