(76, 2, 1, '2021-10-03', 'የቀጣዩ ሳምንት MIS ስልጠና ፕሮግራም\r\nበኮሌጅ/ ኢንስቲትዩት ዲኖች ጥያቄ መሰረት የተዘጋጀና ለሁሉም ኃላፊዎች (አካዳሚክ፣ አስተዳደርና ምርምርና ማህበረሰብ አገልግሎት ዘርፍ) ከዚህ በታች በተገለፀው ፕሮግራም መሰረት የሚስጥ የገፅ ለገፅ ስልጠና \r\n\r\nኃላፊዎች፣ ኮሌጅ/ ኢንስቲትዩት ዲኖች ለሰልጣኞች ጥሪ እንድታደርጉ እናሳስባለን   \r\n\r\n1. ሰኞ ጧት 2፡30 ጀምሮ \r\nበስልጠናው የሚሳተፉ ኃላፊዎች\r\n1. Business And Economics College \r\n2. የዋናው ግቢ ፋይናንስ ዳይሬክተር ኃላፊዎች  \r\n3. የዋናው ግቢ General Service ኃላፊዎች \r\n4. የዋናው ግቢHuman Resource Mgt. Directorate ኃላፊዎች    \r\nየስልጠና ቦታ፡ BECO computer center \r\n\r\n2. ሰኞ ከሰዓት 8፡00 ጀምሮ \r\nበስልጠናው የሚሳተፉ ኃላፊዎች፡ College Of Agriculture and Veterinary Medicine \r\nየስልጠና ቦታ፡ JUCAVM computer center\r\n\r\n3. ማክሰኞ ጧት 2፡30 ጀምሮ   \r\nበስልጠናው የሚሳተፉ ኃላፊዎች\r\n1. College Of Education and Behavioral Sciences\r\n2. College Of Natural Sciences    \r\nየስልጠና ቦታ፡ ሲስኮ አዳራሽ \r\n\r\n4. ማክሰኞ ከሰዓት 8፡00 ጀምሮ \r\nበስልጠናው የሚሳተፉ ኃላፊዎች\r\n1. College Of Law and Governance  \r\n2. የዋናው ግቢ Student Service ኃላፊዎች \r\n3. የዋናው ግቢ Registrar ኃላፊዎች    \r\nየስልጠና ቦታ፡ ሲስኮ አዳራሽ \r\n\r\n5. ረቡዕ ጧት 2፡30 ጀምሮ \r\nበስልጠናው የሚሳተፉ ኃላፊዎች፡ Institute Of Technology   \r\nየስልጠና ቦታ፡ JIT computer center\r\n\r\n6. ረቡዕ ከሰዓት 8፡00 ጀምሮ  \r\nበስልጠናው የሚሳተፉ ኃላፊዎች፡ College Of Social Sciences and Humanities   \r\nየስልጠና ቦታ፡ ሶሻል ሳይንስ ኮምፒውተር ላብ\r\n\r\n7. ሐሙስ ጧት 2፡30 ጀምሮ \r\nበስልጠናው የሚሳተፉ ኃላፊዎች፡ Institute Of Health   \r\nየስልጠና ቦታ፡ JIH ኮምፒውተር ላብ\r\n\r\n 8. ሐሙስ ከሰዓት 8፡00 ጀምሮ   \r\nበስልጠናው የሚሳተፉ ኃላፊዎች፡\r\n1. Sport Academy \r\n2. የዋናው ግቢ CDE ኃላፊዎች\r\n3. Library ኃላፊዎች    \r\nየስልጠና ቦታ፡ ሲስኮ አዳራሽ'),
