INSERT INTO `user_group` (`id`, `registered_by_id`, `updated_by_id`, `name`, `description`, `created_at`, `updated_at`, `is_active`) VALUES
(1, 3, 1, 'System Admin', '<p>The Director of Strategic Management, who manages the system, has the right to manage all the rights contained in the system.</p>\r\n\r\n<p>These are as follows:</p>\r\n\r\n<ul>\r\n	<li>Creates,</li>\r\n	<li>registers,</li>\r\n	<li>edits,</li>\r\n	<li>deactivates,</li>\r\n	<li>deletes, and</li>\r\n	<li>adds users. Improved variables also include Views, Goals, Objectives, Strategies, KPIs, Initiatives, Users, Privacy, Principal Manager, Principal Office, performer, operational manager, principal manager, initiative behavior, initiative, attributes, planning year, planning report announcement, quarter report and etc</li>\r\n	<li>&nbsp;</li>\r\n	<li>ስርዓቱን የሚያስተዳድረው የስትራቴጂክ ማኔጅመንት ከፍተኛ ዳይሬክተር በሲስተሙ ላይ የተካትቱ ሁሉንም መብቶች የማስተዳደር መብቶች አሉት። እነዚህም የሚከተሉት ናቸው፤ ቫሪየብሎችን ይፈጥራል፣ ይመዘግባል፣ አርትዖት ያድረጋል፣ ማቦዘን፣ ይሰርዛል፣ ተጠቃሚዎችን ያክላል። የሚሻሻሉ ቫሪየብሎችም የሚከተሉትን ያካትታሉ- ዕይታ፣ ግቦች ፣ ዓላማዎች ፣ ስትራቴጂዎች ፣ KPIs ፣ ኢኒሼቲቮች፣ ተጠቃሚዎች፣ ፈቃድ፣ ፕሪንሲፓል ስራስኪያጅ፣ ፕሪንሲፓል ጽ/ቤት፣ ኦፕሬሽናል ስራ አስኪያጅ፣ ኦፕሬሽናል ጽ/ቤት፣ አኒሼቲቭ፣ የእቅድ ዓመት ፣ የእቅድ ሪፖርት ማስታወቂያ ፣ የሩብ ዓመት ሪፖርት እና ወዘተ</li>\r\n</ul>', '2021-06-22 12:06:54', '2021-11-16 09:26:41', 1),
(2, 2, 2, 'MIS team', 'This group allows users to edit the system. It also deploys users to the group, can see users of the system,\r\n\r\nHowever, this group is not responsible for creating, registering, or editing variables. Similarly, the team does not have the power to change strategic vision, goals, objectives, strategies, KPIs, initiatives, new registers and delete \r\n\r\nይህ ቡድን የሲስተሙን ተጠቃሚዎች አርታኦት እንዶሰራ የፈቅዶለታል። በተጨማሪም ተጠቃሚዎችን ወደቡድኑ ያሰማራል፣ የሲስተሙን ተጠቃሚዎች ማየት ይችላል፣  \r\n\r\nይሁናን ይህ ቡድን ቫሪየብሎችን የመፍጠር፣ አዲስ የመመዝገብ፣፣ አርትዖት የማድረግ ኃላፊነቶች የለውም። በተመሳሳይም ቡድኑ ስትራተጂያዊ ዕይታ፣ ግቦች፣ ዓላማዎች ፣ ስትራቴጂዎች ፣ KPIs ፣ ኢኒሼቲቮች መቀየር፣ አዲስ መመዝገብና መሰረዝ ስልጣንም የለውም', '2021-06-22 21:42:37', '2021-08-09 14:06:17', 1),
(3, 2, 1, 'Principal Managers', 'These include deans of the college, vice presidents of the institute, senior directors, center directors and vice-directors, heads of research centers, head of the sports academy and dean of the faculty of Public health and student union.\r\n\r\nThese managers do the following\r\n1. Together with the Operations Managers, select appropriate initiatives for their office;\r\n2. Evaluate the performance of the operational managers;\r\n3. Receive reports from operational managers and verify their accuracy and send them to Jimma University.\r\n4. You can see the report of their office work,\r\n5. Perform their own duties as executors; Their superiors will also be evaluated\r\nHowever, they are not allowed to see reports from other sister offices \r\n\r\nእነዚህ የኮሌጅ ዲኖች ፣ የኢንስቲትዩት ምክትል ፕሬዚዳንቶች፣ ሲኒየር ዳይሬክተሮች፣ በማዕከል የሚገኙ ዳይሬክተሮችና ምክትል ዳይሬክተሮች፣ የምርምር ማዕከላት ኃላፊዎች ፣ የስፖርት አካዳሚ ኃላፊና የማህበረሰብ ጤና ፋኩልቲ ዲን፣ የተማሪ ህብረት ፕሬዚዳንትን ያካትታል፡፡ \r\n\r\nእነዚህ ሥራ አስኪያጆች የሚከተሉትን ስራ ይሰራሉ \r\n1. ለኦፕሬሽናል ስራ አስኪያጆች ጋር በጋራ ሆነው ለቢሯቸው ተስማሚ ኢኒሼቲቮች ይመርጣሉ፤ \r\n2. የኦፕሬሽናል ስራ አስኪያጆችን የስራ አፈፃፀም ይገመግማሉ፣ \r\n3. ከኦፕሬሽናል ስራ አስኪያጆች የሚላኩ ሪፖርቶችን ተቀብለው ትክክለኛቱን ካረጋገጡ በኃላ ወደ ጅማ ዩኒቨርሲቲ ይልካሉ። \r\n4. የቢራቸውን ስራ ሪፖርት ማየት ይችላሉ፣ \r\n5. እንደፈፃሚ ሆነው የራሳቸውን ስራ ይፈፅማሉ፤ በቅርብ አለቆቻቸውም ይገመገማሉ \r\nይሁናን የሌላ እህት ቢሮዎችን ሪፖርቶች ከማየት የተከለከሉ ናቸው', '2021-06-22 22:00:10', '2021-12-20 12:28:16', 1),
(4, 2, 324, 'Operational managers', 'These are Department Heads, Teams under Directorates, Coordination offices in colleges and Institutes. \r\n\r\nThese operational managers are given the right to: list tasks, distribute tasks to performers, set performers\' reporting time, receive performers\' performance reports and evaluate performances of performers\' reports, and review performers\' reports.\r\n\r\nThey can also see plan and achievement report of their sister teams under the same principal offices \r\n\r\n\r\nእነዚህ የትምህርት ክፍል ኃላፊዎች፣ በዳይሬክቶሬቶች ስር ያሉ ቡድኖች፣ በኮሌጆችና ተቋማት ውስጥ ያሉ ማስተባበሪያ ጽ/ቤቶች ናቸው ፡፡\r\n\r\nእነዚህ ኦፕሬሽናል ሥራ አስኪያጆች የሚከተሉትን የማድረግ መብት ተሰጥቷቸዋል-ሥራዎችን መዘርዘር፣ ሥራዎችን በስራቸው ላሉ ፈፃሚዎች አከፋፍሎ መስጠት፣ ፈፃሚዎች ሪፖርት የሚያቀርቡበትን ጊዜ መወሰን፣ የስራ ፈፃሚዎችን የአፈፃፀም ሪፖርቶችን መቀበልና የስራ አፈፃፀም ውጤት መሙላት፣  የስራ ፈፃሚዎችን ሪፖርቶችን የመመልከት መብት ተሰጥቷቸዋል ፡፡\r\n\r\nበተመሳሳይ ዋና ጽ/ቤቶች ስር ያሉ የእህቶቻቸውን ቡድን እቅድ እና ስኬት ሪፖርትም ማየት ይችላሉ', '2021-06-22 22:09:04', '2021-11-27 17:34:58', 1),
(5, 2, 2, 'Vice Presidents and JU President', 'They have the full right to view and comment on reports of Principal and operational Mangers . Through the Senior Directorate of Strategic Management, they can also recommend the modification of institutional vision, goals, objectives, strategies, KPIs and initiatives. \r\n\r\nየፕሪንሲፓልና ኦፕሬሽናል ሥራ አስኪያጆችን ሪፖርቶች የመመልከት እና አስተያየት የመስጠት ሙሉ መብት አላቸው፡፡ በስትራቴጂክ ማኔጅመንት ከፍተኛ ዳይሬክቶሬት በኩል የተቋማት ራዕይ ፣ ግቦች ፣ ዓላማዎች ፣ ስትራቴጂዎች ፣ ኬፒአይዎች እና ተነሳሽነቶች እንዲሻሻሉም መምከር ይችላሉ ፡፡', '2021-06-22 22:11:27', '2021-09-16 21:17:58', 1),
(6, 2, NULL, 'Guests', 'This can be anyone who visits Jimma University at any time or stays on campus for a while and does not have a username to enter the MIS.\r\n\r\nThese guests can log in to the login page using mis2.ju.edu.et and get information about the university from the dashboard at the entrance to the page.\r\n\r\nይህ ጅማ ዩኒቨርሲቲን በማንኛውም ጊዜ የሚጎበኝ ወይም በዩኒቨርሲቲው ግቢ ውስጥ  ለተወሰነ ጊዜ የሚቆይ እና ወደ MIS ለመግባት የተጠቃሚ ስም የሌለው ማንኛውም ሰው ሊሆን ይችላል ፡፡\r\n\r\nእነዚህ እንግዶች mis2.ju.edu.et ን በመጠቀም ወደ ምዝግብ ገጹ ሊገቡ ይችላሉ እና በገጹ መግቢያ ላይ ካለው ዳሽቦርድ ስለዩኒቨርስቲው መረጃ ማግኘት ይችላሉ ፡፡', '2021-06-22 22:15:24', NULL, 1),
(7, 2, NULL, 'HRM', 'The Human Resource Directorates at the main campus and at each college / institution will not have a paper-based evaluation of the employee\'s behavior in the past, but will print the employee\'s performance report evaluated by the following criteria and print it on the system.\r\n\r\nQualifications: 1. Amount of work assigned and received by the immediate Operations Manager.\r\n2. Automatic results of the system automated within the agreed time frame. 3. Employee Behavior (by improving previous standards); 4. Employee evaluation of his / her own performance; Average score \r\n\r\nበዋናው ግቢና በየኮሌጂ/ ኢንስቲትዩት ያሉ የሰው ኃብት ዳይሬክቶሬቶች/ ፅ/ቤቶች ቀደም ሲል በወረቀት ብቻ ሲካሄድ የነበረውን የሰራተኞች ባህርይ ግምገማ በመተው ከዚህ በታች ባሉ መመዘኛዎች የተገመገሙ የሰራተኞችን የስራ አፈፃፀም የውጤት ሰርተፊኬት ከሲስተሙ ላይ ፕሪንት በማድረግ ሰራተኞች በዚሁ የግምገማ ውጤት መሰረት እንዲዳኙ ያደርጋል።  \r\n\r\nመመዘኛዎች፡ 1. ከቅርብ አለቃ /ኦፕሬሽናል ስራ አስኪያጅ ተቆጥሮ የተሰጠና ተቆጥሮ የተቀበለ የስራ መጠን/ ብዛት፣ \r\n2. የተሰጡ ስራዎች እንዲቀርቡ ስምምነት በተደረሰበት የጊዜ መጠን ሲስተሙ ባውቶማቲክ የሰጠው ውጤት 3. የሰራተኛ ባህርይ/ ቀድሞ የነበረውን መመዘኛ በማሻሻል/፣ 4. ሰራተኛው የራሱን የስራ አፈፃፀም ገምግሞ ለራሱ የሰጠው ውጤት፣ 5. የስራ ባልደርቦች ለጓደኛቸው የሰጡት ውጤትና 6. ደንበኛው ለተገልጋዩ የሰጠውን ውጤት ከግምት ያስገባ አማካይ ውጤት', '2021-06-22 23:03:58', NULL, 1),
(8, 2, NULL, 'Peers', 'These are colleagues in the same field and in the same team.\r\nThese peers evaluate the team\'s intellectual performance and the technical skills of their partner. \r\nTo this end, the Operations Manager secretly assigns five reviewers from the team to evaluate the performance of one reviewer.\r\nTherefore, the confidential peer to evaluate the partner evaluates the performance of the friend according to the criteria specified in the system. \r\n\r\nእነዚህ በአንድ መስክና በተመሳሳይ ቡድን ውስጥ ያሉ የስራ ባልደረባዎች/ ባለሙያዎች ናቸው ፡፡\r\nእነዚህ እኩዮች የቡድን ጓደኛቸውን ምሁራዊ ሥራ አፈፃፀምና የባልደረባቸውን የቴክኒካዊ ችሎታ ይገመግማሉ፡፡ ለዚህም ተግባራዊነት የኦፕሬሽናል ሥራ አስኪያጁ የአንድ ተገምጋሚን ስራ አፈፃፀም ለመገምገም ከቡድኑ ውስጥ ለአምስት ሥራ ፈፃሚዎች በሚስጢር ይመድባል ፡፡\r\nስለዚህ ባልደረባውን እንዲገመግም በምስጢር የተመደበው እኩያ አባል በስርዓቱ ውስጥ በተጠቀሰው መስፈርት መሠረት የጓደኛውን ስራ አፈፃፀም ይገመግማል', '2021-06-22 23:04:09', NULL, 1),
(9, 2, NULL, 'Customers (students)', 'students evaluation is an integral assessment by learners for the service provided by their teachers. \r\n\r\nThe evaluation will depend on classroom activities and all aspects of the learning experiences. \r\n\r\nto this practicality, five students from a classroom will be randomly and secretly selected by the operational managers. Then the operational managers will invite these students to sign in to MIs by using their own credentials and evaluate the students \r\n\r\nThese students will evaluate their teachers before the start of examination periods based on the evaluation format attached to the MIS. any evaluation made after exam period will be voided \r\n\r\nየተማሪዎች ምዘና በአስተማሪዎቻቸው ለሚሰጡት አገልግሎት በተማሪዎች ዘንድ ወሳኝ ግምገማ ነው ፡፡\r\n\r\nግምገማው የሚወሰነው በክፍል ውስጥ ተግባራት እና በሁሉም የትምህርት ልምዶች ገጽታዎች ላይ ነው ፡፡\r\n\r\nለዚህ ተግባራዊነት በክፍል ውስጥ አምስት ተማሪዎች በአጋጣሚ ሥራ አስኪያጆች በዘፈቀደ እና በድብቅ ይመረጣሉ ፡፡ ከዚያ የአሠራር ሥራ አስኪያጆቹ እነዚህ ተማሪዎች የራሳቸውን ማስረጃ በመጠቀም በመጠቀም ወደ ኤም.ኤስ. እንዲገቡ ይጋብዛሉ እና ተማሪዎችን ይገመግማሉ\r\n\r\nእነዚህ ተማሪዎች ከ MIS ጋር በተያያዘው የግምገማ ቅርጸት መሠረት የፈተና ጊዜ ከመጀመሩ በፊት መምህሮቻቸውን ይገመግማሉ ፡፡ ከፈተና ጊዜ በኋላ የሚደረግ ማንኛውም ግምገማ ዋጋ ቢስ ይሆናል', '2021-06-22 23:04:24', NULL, 1),
